        "className": "admonition-content"
      }}><p parentName="div">{`RKE add-on 安装仅支持 Rancher v2.0.8 之前的版本。
请使用 Rancher helm chart 将 Rancher 安装在 Kubernetes 集群上。有关详细信息，请参见`}<a parentName="p" {...{
            "href": "/docs/rancher2/installation/k8s-install/_index"
          }}>{`Rancher 高可用安装`}</a>{`。
如果您当前正在使用 RKE add-on 安装方法，参见`}<a parentName="p" {...{
            "href": "/docs/rancher2/upgrades/upgrades/migrating-from-rke-add-on/_index"
          }}>{`将 RKE add-on 安装的 Rancher 迁移到 Helm 安装`}</a>{`，获取有关如何使用 Helm chart 的详细信息。`}</p></div></div>
    <p>{`要调试此错误，您需要下载命令行工具 `}<inlineCode parentName="p">{`kubectl`}</inlineCode>{`。请参阅`}<a parentName="p" {...{
        "href": "https://kubernetes.io/docs/tasks/tools/install-kubectl/"
      }}>{`安装和设置 kubectl`}</a>{`，了解如何在您的平台上下载和配置 `}<inlineCode parentName="p">{`kubectl`}</inlineCode>{`。`}</p>
    <p>{`当您对 `}<inlineCode parentName="p">{`rancher-cluster.yml`}</inlineCode>{` 进行更改后，您需要运行 `}<inlineCode parentName="p">{`rke remove --config rancher-cluster.yml`}</inlineCode>{` 来清理节点，避免与以前的错误配置产生冲突。`}</p>
