    <pre><code parentName="pre" {...{}}>{`kubectl --kubeconfig kube_config_rancher-cluster.yml logs -l job-name=rke-user-addon-deploy-job -n kube-system
`}</code></pre>
    <h2 {...{
      "id": "error-error-converting-yaml-to-json-yaml-line-9"
    }}>{`error: error converting YAML to JSON: yaml: line 9`}</h2>
    <p><inlineCode parentName="p">{`rancher-cluster.yml`}</inlineCode>{` 中安装插件 Job 定义有误。您可以根据 `}<inlineCode parentName="p">{`yaml line 9`}</inlineCode>{` 所标识的引用行号寻找错误原因。`}</p>
    <p><strong parentName="p">{`需要检查`}</strong></p>
    <ul>
      <li parentName="ul">{`是否将每个 Base64 编码的证书字符串直接放置在密钥之后，例如: `}<inlineCode parentName="li">{`tls.crt: LS01...`}</inlineCode>{`，在此前后和之间确保没有任何换行符。`}</li>
      <li parentName="ul">{`YAML 的格式是否正确，缩进应为 `}<strong parentName="li">{`2`}</strong>{` 个空格。`}</li>
      <li parentName="ul">{`运行以下命令验证证书的完整性，如果存在任何错误，命令输出将显示。`}<ul parentName="li">
          <li parentName="ul">{`Linux：`}<inlineCode parentName="li">{`cat MyCertificate | base64 -d`}</inlineCode></li>
          <li parentName="ul">{`Mac OS：`}<inlineCode parentName="li">{`cat MyCertificate | base64 -D`}</inlineCode></li>
        </ul></li>
    </ul>
    <h2 {...{
      "id": "error-from-server-badrequest-error-when-creating-etcconfigrke-user-addonyaml-secret-in-version-v1-cannot-be-handled-as-a-secret"
    }}>{`Error from server (BadRequest): error when creating “/etc/config/rke-user-addon.yaml”: Secret in version “v1” cannot be handled as a Secret`}</h2>
    <p>{`某个证书的 Base64 编码的字符串有误。日志消息将尝试向您显示字符串的哪一部分未被识别为有效的 Base64 编码。`}</p>
    <p><strong parentName="p">{`需要检查`}</strong></p>
    <p>{`通过运行以下命令之一检查 Base64 字符串是否有效：`}</p>
    <pre><code parentName="pre" {...{}}>{`
## MacOS

echo BASE64_CRT | base64 -D

## Linux

echo BASE64_CRT | base64 -d

## Windows

certutil -decode FILENAME.base64 FILENAME.verify
`}</code></pre>
    <h2 {...{
      "id": "the-ingress-cattle-ingress-http-is-invalid-specrules0host-invalid-value-ip-must-be-a-dns-name-not-an-ip-address"
    }}>{`The Ingress “cattle-ingress-http” is invalid: spec.rules`}{`[0]`}{`.host: Invalid value: “IP”: must be a DNS name, not an IP address`}</h2>
    <p>{`在 `}<inlineCode parentName="p">{`spec.rules[0].host`}</inlineCode>{` 中只能定义一个主机名，因为 ingress controller 需要该名称来匹配请求头中描述的 `}<inlineCode parentName="p">{`Host`}</inlineCode>{` ，并传递给正确的应用服务。`}</p>
